import React , {Component} from 'react';
import Input from '../Form/input';
import Auxiliary from '../../hoc/Auxiliary/Auxiliary';
import classes from './admin.module.css';

const admin= (props)=>{

    

    
 



    return (
        <Auxiliary>
        <div className={classes.Form}>
        <Input 
        id = 'title'
        onChange={(event)=>this.inputChangedHandler(event,'title')} 
        elementtype='text' 
        label='Title'/>

<Input 
        id= "price"
        onChange={(event)=>this.inputChangedHandler(event,'price')} 
        elementtype='text' 
        label='Price'/>
    
    <Input 
        id="image"
        onChange={(event)=>this.inputChangedHandler(event,'file')} 
        elementtype='file' 
        label='Image'/>
    
<Input
id="description"
onChange={(event)=>props.changed(event,'desc')} 
elementType="textArea"
label="Desciption"
/>

        </div>

<div >
<a href="" className={classes.Btn} onClick={props.click}>Add</a>
<a href="" className={classes.Btn}>Cancel</a>

</div>
</Auxiliary>
    )
    



}


export default addmin;
